import { useState } from "react";

function App() {
  const [toDo, setToDo] = useState("");
  const onChange = (event) => {
    setToDo(event.target.value);
    console.log(toDo);
  }
  return (
    <div>
        <form>
        <input 
          type="text" 
          placeholder="Write your to do..." 
          onChange={onChange}
        />
        <button>Add To Do</button>
      </form>
    </div>  
  );
}

export default App;
